import React from "react";
import "./style.css";
// import Nav from "./Nav";

function Header() {
  return (
    <div>
    <div className="jumbotron text-center">
      <h1>Google Book Search</h1>
      <h4>You can search for a book using the search bar
      <h4></h4>and save it for later</h4>
    </div>
    </div>
  );
}

export default Header;
